import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './SliderComponent.css'; // Importa el archivo CSS con los estilos personalizados

const Recientes = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <div className="container">
      <div className="row">
        <div className="col-6">
          <Slider {...settings}>
            <div>
              <img src="ruta_de_la_imagen_1" alt="Imagen 1" />
            </div>
            <div>
              <img src="ruta_de_la_imagen_2" alt="Imagen 2" />
            </div>
          </Slider>
        </div>
        <div className="col-6">
          <div className="content">
            <h2>Ver conciertos y eventos recientes</h2>
            <button className="btn btn-primary">Ver</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Recientes;
